INSERT INTO public."Entertainments"("Id", "Price", "TypeEntertainment", "Details", "Area", "Latitude", "Longitude", "CreationDate", "City", "UrlImage", "Name", "UrlSite")
VALUES ('gen_random_uuid()', "0", 5, 'Организуем любое ваше мероприятие в стиле знаменитого игрового шоу «Форт Боярд». Детские и взрослые дни рождения, окончание учебного года, выпускные и корпоративы. Необычные испытания разной сложности. Площадка площадью 500 кв.м. С реквизитом более чем на 1500 кг. Организация любого праздника под ключ. От 10 до 110 человек.', 0, 56.48265, 85.00637, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/FortBoyard/', 'Форт Боярд', 'https://fort-tomsk.ru/'),
('gen_random_uuid()', "0", 5, 'Наши квесты помогут вам прекрасно провести вечер, день рождения или другое яркое событие. Невиданное событие! Академия величайшего преступника всех времён и народов запускает крутейший спецкурс «Миссия Луна»! Рискнувшие пройти его и повторить кражу Луны несравненным Грю смогут найти в себе зерно настоящего духа миньона или не вернуться!', 3, 56.46458, 84.9483, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/AkademiaMinioni/', 'Академия грю.Миньоны.', 'https://miniones.ru/'),
('gen_random_uuid()', "0", 5, 'MATRIX VR CLUB это: • 4 игровые зоны, для одного игрока каждая. Оплата взимается за зону, а не за игрока. Гостевая зона с диванами, столиками и игровой приставкой Sony PlayStation 4 на двух игроков. • Индивидуальный подход к каждому гостю. На протяжении всей игровой сессии вам будут помогать опытные администраторы. • Проведение мероприятий: дней рождения, праздников, вечеринок, тимбилдингов. Возможность принести с собой еду и безалкогольные напитки. • Мощное оборудование, гарантирующее получение полной гаммы впечатлений от виртуальной реальности (шлемы виртуальной реальности HTC Vive).', 0, 56.48178, 84.98107, '2022 -10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/MatrixVrClub/', 'MATRIX VR CLUB', 'https://matrixvr.club/event'),
('gen_random_uuid()', "0", 5, 'Привет! Меня зовут Владимир Епифанцев (клоун Вовчик), и я основатель «Арены развлечений», аниматор с опытом 13 лет и более чем с 450 отзывами довольных клиентов. За долгое время работы в сфере event (мероприятий) мы придумали много крутых фишек. Новые тренды, мультимедиа в праздниках, шоу, нестандартный реквизит — мы стараемся детям дать больше, чем они ожидают. Умеем всё! Организуем под ключ любой детский праздник — от дня рождения вашего малыша до мероприятия городского масштаба. Приглашаем отпраздновать ваше мероприятие в наши лофты: arena loft и confetti room. У нас играют и отдыхают не только дети, но и родители!', 0, 56.47787506825895, 84.98875549999988, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/ArenaEntertainments/', 'Арена развлечений', 'https://arena-razvlechenij.clients.site/'),
('gen_random_uuid()', "3000", 5, 'Отличное место, куда вам стоит сходить с ребёнком! Отметить день рождения или просто весело провести время всей семьёй. Вы хотели отметить успехи в школе? Замотивировать на достижение в новой четверти? Или провести незабываемо время? Отметить день рождения или любой другой праздник? Приходите к наш реалити-квест! Вы можете прийти как всей семьёй, так и привести большую компанию друзей. Квест рассчитан на компании от 2 до 8 человек. Наши головоломки распределены по уровням сложности, так что будет интересно как 6-летнему ребёнку, так и детям гораздо старше по возрасту. В нашем реалити-квесте будет интересно детям от 7 лет и людям до 99 лет. Записывайтесь на игры и получайте удовольствие. Ведь наша жизнь — игра!', 2, 56.50994106822116, 84.97323249999995, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/SecretWorld/', 'Тайные миры', ''),
('gen_random_uuid()', "", 5, 'Уникальные квесты, тематические интерактивные программы, зажигательные вечеринки! Мы работаем только со своими ведущими. На каждой программе мультимедийное сопровождение на экране, микрофоны, профессиональный свет и звук! Мы взяли всё самое крутое у взрослых и адаптировали это для детей. На наших праздниках — как у взрослых, только круче. ', 1, 56.499349568223955, 84.99612199999999, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/NiceParty/', 'KRUTO пати', 'https://krutopati.ru/'),
('gen_random_uuid()', "0", 5, 'Детские и взрослые вечеринки, дни рождения и другие праздники в лазертаг-клубе «АтАкА». Насыщенная программа на 3 часа: • два часа игры в лазертаг с инструктором; • всем полюбившиеся и никому неизвестные игровые сценарии; • полигон - лабиринт 360 кв.м от 6 до 30 человек; • комната отдыха для чаепития на час после игры; • дополнительные бесплатные развлечения; • фотосессия; • сувениры. Предварительное бронирование обязательно! Звоните и бронируйте корпоративы, дни рождения, активные игры для большой компании.', 2, 56.49150406823386, 84.9495264999999, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/attack/', 'АтАкА(лазертаг-клуб)', 'http://ataka70.ru/'),
('gen_random_uuid()', "0", 5, 'В ПЛЕНУ У БАСТИНДЫ..это уникальный опыт погружения в интерактивное повествование сказки. Для ребятишек оживают сказочные персонажи, им предстоит пережить настоящие приключение! Первый в Томске уникальный интерактивный квест с аниматором и заводной собачкой.', 3, 56.467195568261545, 84.96594749999997, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/bastinda/', 'В плену у Бастинды', 'https://bastinda.business.site/'),